webpackJsonp([0xa0dee5645307],{372:function(A,e){A.exports={data:{contentfulBlogPost:{title:"A Piece of My Story",createdAt:"February 18, 2018",featuredImage:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5238095238095237,src:"//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=800&q=50",srcSet:"//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=200&h=131&q=50 200w,\n//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=400&h=263&q=50 400w,\n//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=800&h=525&q=50 800w,\n//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=1200&h=788&q=50 1200w,\n//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=1248&h=819&q=50 1248w",srcWebp:"//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=800&q=50&fm=webp",srcSetWebp:"//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=200&h=131&q=50&fm=webp 200w,\n//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=400&h=263&q=50&fm=webp 400w,\n//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=800&h=525&q=50&fm=webp 800w,\n//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=1200&h=788&q=50&fm=webp 1200w,\n//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg?w=1248&h=819&q=50&fm=webp 1248w",sizes:"(max-width: 800px) 100vw, 800px"},id:"c2pV3fYnoq0E80s8SuO6GkK",file:{url:"//images.ctfassets.net/t8j0ewtik3c3/2pV3fYnoq0E80s8SuO6GkK/bf8e90962701acda5f785ee00663cefd/a-piece-of-my-story.jpg",fileName:"a-piece-of-my-story.jpg",contentType:"image/jpeg"}},content:{childMarkdownRemark:{html:"<p>Last month my pastor asked if I would share part of my story with the congregation. He was talking about the healing power of Jesus. He wanted me to express how the Lord and my faith have helped me through a difficult time in my life; and how they are continuing to help.</p>\n<p>With the talent of a friend, we had it video recorded and then played on Sunday morning. I am always happy to share some of my story with those who are interested. I love sharing for a few different reasons:</p>\n<ol>\n<li>It reminds others, and myself, that <a href=\"http://abovethebattle.com/five-reasons-to-not-strive-for-perfection/\">I am not perfect</a>. I have struggles, my life feels like it's falling apart sometimes. I want people to know that about me. We are all in this together.</li>\n<li>It's a step out of my comfort zone, and I believe it's the things we are afraid of that we must do.</li>\n<li>It gives me a chance to share about the love and presence of God I have in my life. I want everyone to know what I experienced, and sharing my story gives me a chance to do that without being too 'preachy'.</li>\n<li>And the last reason is, hopefully, I can provide comfort and hope to someone else who is in a similar situation. I got through it. You will get through it.</li>\n</ol>\n<p>In this video I share only bits and pieces of my story. <strong>It's not even close to the full reality I was facing</strong>, this was a five minute clip for church. I couldn't show any of my meltdowns as my grandma held me tight, my sleepless face, my blank mind, the pain I had in my gut, and the fear that followed me everywhere. That's not something you can capture in five minutes.</p>\n<p>If you'd like to watch it, please do. If you'd like to share it with someone you know who is hurting, please share. If you want to learn more about a loved one who is struggling with anxiety and depression, this might give you a small glimpse into their thought processes.</p>\n<p><a href=\"https://www.youtube.com/watch?v=MV76gJMmdEc&#x26;feature=youtu.be\">https://www.youtube.com/watch?v=MV76gJMmdEc&#x26;feature=youtu.be</a></p>"}}}},pathContext:{slug:"a-piece-of-my-story"}}}});
